pragma solidity ^0.5.0;

import "./external/AddressList.sol";
import "./external/Owned.sol";
import "./Interfaces.sol";

/// @title Transaction Delegate
/// @author Joseph Reed
/// @dev The goal of this contract is to act as an authority for executing future transactions
contract TransactionDelegate is ITransactionDelegate {

    using AddressListLib for AddressListLib.AddressList;          // Import the data structure AddressList
    uint public blockCreated = block.number;                      // The block the payment delegate was deployed
    mapping (address => AddressListLib.AddressList) transactions; // The list of future transactions per account

    /// @notice Executes a transfer for the transaction associated with 'msg.sender'
    /// @param token The token to send for the payment
    /// @param recipient The recipient of the specified amount of tokens
    /// @param amount The amount of tokens to send to the recipient
    /// @return True if the transfer executed successfully
    function transfer (address token, address payable recipient, uint amount) public returns (bool success) {
      IFutureTransaction transaction = IFutureTransaction(msg.sender);
      require(valid(transaction), "invalid transaction");
      success = transaction.wallet().transfer(token, recipient, amount);
      emit Execute_event (transaction, success);
    }

    /// @notice Executes a call for the transaction associated with 'msg.sender'
    /// @param callAddress The address to call
    /// @param callValue The amount of ether to send with the call
    /// @param callData The data to send along with the call
    /// @return True if the call executed successfully. False otherwise.
    /// @return The data returned from the call
    function call (address callAddress, uint callValue, bytes memory callData) public returns (bool success, bytes memory returnData) {
      IFutureTransaction transaction = IFutureTransaction(msg.sender);
      require(valid(transaction), "invalid transaction");
      (success, returnData) = transaction.wallet().call(callAddress, callValue, callData);
      emit Execute_event (transaction, success);
    }

    /// @notice Schedules a transaction. Only callable by a wallet delegate
    /// @param transaction The transaction contract responsible for holding logic and data about the transaction
    /// @return True if the transaction was scheduled successfully
    function schedule (IFutureTransaction transaction) public returns (bool success) {
      require(transaction.wallet().isDelegate(msg.sender), "msg sender must be a wallet delegate");
      success = transactions[address(transaction.wallet())].add(address(transaction));
      if(success) emit Schedule_event(msg.sender, transaction);
    }

    /// @notice Unschedules a transaction. Only callable by a delegate of the wallet associated with the transaction.
    /// @param transaction The contract responsible for holding logic and data about the transaction
    /// @return True if the transaction was unscheduled successfully
    function unschedule (IFutureTransaction transaction) public returns (bool success) {
      require(valid(transaction), "transaction is not scheduled with supplied wallet");
      require(transaction.wallet().isDelegate(msg.sender), "msg sender must be a wallet delegate");
      success = transactions[address(transaction.wallet())].remove(address(transaction));
      if(success) emit Unschedule_event(msg.sender, transaction);
    }

    /// @notice Allows a transaction to unschedule itself
    /// @return True if the transaction was unscheduled successfully
    function clear () public returns (bool success) {
      IFutureTransaction transaction = IFutureTransaction(msg.sender);
      success = transactions[address(transaction.wallet())].remove(address(transaction));
      if(success) emit Unschedule_event(msg.sender, transaction);
    }

    /// @notice Indicates whether a transaction is valid
    /// @param transaction The transaction to check for validity
    /// @return True if the transaction wallet list contains the given 'transaction'
    function valid (IFutureTransaction transaction) public view returns (bool) {
      return transactions[address(transaction.wallet())].contains(address(transaction));
    }

    /// @notice Fetches the transactions scheduled for 'wallet'
    /// @param wallet The wallet to from which to fetch the transactions
    /// @return The list of transactions associated with 'wallet'
    function getTransactionList (IDelegatedWallet wallet) public view returns (address[] memory) {
        return transactions[address(wallet)].getList();
    }

    /// @notice Fetches the total number of transactions of a given wallet
    /// @param wallet The wallet from which to fetch the amount of transactions
    /// @return The number of transactions associated with the 'wallet'
    function getTotalTransactions (IDelegatedWallet wallet) public view returns (uint) {
        return transactions[address(wallet)].getLength();
    }

    /// @notice Fetches a transaction from the provided wallet at a given index
    /// @param wallet The wallet from which to fetch the transaction
    /// @param i The index of the transaction to fetch
    /// @return The transaction at index 'i'
    function getTransactionAtIndex (IDelegatedWallet wallet, uint i) public view returns (IFutureTransaction) {
        return IFutureTransaction(transactions[address(wallet)].getValueAt(i));
    }

    /// @notice Fetches the index of a transaction from a provided wallet
    /// @param transaction The transaction from which to retrieve the index
    /// @return The index of the provided 'transaction'
    function getIndexOf (IFutureTransaction transaction) public view returns (uint) {
      return transactions[address(transaction.wallet())].getIndexOf(address(transaction));
    }

    event Execute_event (IFutureTransaction indexed transaction, bool success);
    event Schedule_event (address indexed caller, IFutureTransaction indexed transaction);
    event Unschedule_event (address indexed caller, IFutureTransaction indexed transaction);

}

